const root = {
    botonGreen: "#63FF80",
    mainGreen: "rgb(127,212,97)"
}

const paperLogin = {
    display: "flex",
    maxHeight: "76%",
    // width: "40rem",
    margin: "10rem auto",
    borderRadius: "1rem"
};
const logoHuertaLoguin = {
    paddingTop: "50%",
    width: "100%"
}
const colorButton = {
    backgroundColor:`${root.botonGreen}`,
    color: "black",
    marginBottom: '10%'
}

const bgColorLogo = {
    width: "19rem",
    backgroundColor:`${root.mainGreen}`,
    padding: "2rem"
}
export {paperLogin, logoHuertaLoguin, colorButton, bgColorLogo};
